import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { AuthContextProvider } from './state/AuthContext';

ReactDOM.render(
  <React.StrictMode>
			<AuthContextProvider>
    <App />
			</AuthContextProvider>
  </React.StrictMode>,
	document.getElementById("root")
);
